// CataloguePage.js
import React from 'react';
import { Card } from 'react-bootstrap';

const CataloguePage = ({ handleAddToFavorites }) => {
  const albums = [
    { id: 1, title: 'Album 1' },
    { id: 2, title: 'Album 2' },
    { id: 3, title: 'Album 3' },
  ];

  return (
    <div>
      <h1>Catalogue</h1>
      {albums.map(({ id, title }) => (
        <Card key={id}>
          <Card.Body>
            <Card.Title>{title}</Card.Title>
            <button onClick={() => handleAddToFavorites({ id, title })}>
              Add to Favorites
            </button>
          </Card.Body>
        </Card>
      ))}
    </div>
  );
};

export default CataloguePage;
